            <input type="password" placeholder='Set Password'/>

            <div className="signin">
                <button>Create Account</button>
            </div>
            <h6>Already have an account? Sign in</h6>
           </div>
           </div>
           */}
            </div>
            <div className="col-md-4 bluebg">
            </div>
        </div>
        </div>
    </div>
    </>
  )
}

export default AccountC
